function topKFrequent(nums: number[], k: number): number[] {
    let frequencyMap = new Map<number, number>();
    let result: number[] = [];
    
    nums.forEach(num => {
        frequencyMap.set(num, (frequencyMap.get(num) || 0) + 1);
    });

    let sortedEntries = Array.from(frequencyMap.entries()).sort((a, b) => b[1] - a[1]);

    for (let i = 0; i < k; i++) {
        result.push(sortedEntries[i][0]);
    }

    return result;
}

